  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0129849 includes physical,
  profile and underway data collected aboard the ROGER REVELLE during cruise RR1204
  in the Philippine Sea and South China Sea (Nan Hai) from 2012-04-24 to 2012-05-14.
  These data include CONDUCTIVITY, CURRENT SPEED - EAST/WEST COMPONENT (U), CURRENT
  SPEED - NORTH/SOUTH COMPONENT (V), SALINITY and WATER TEMPERATURE. The instruments
  used to collect these data include ADCP, CTD and GPS. These data were collected
  by Arnold Gordon of Columbia University; Lamont-Doherty Earth Observatory, and by
  University of California - San Diego; Scripps Institution of Oceanography as part
  of Continental shelf embayments of the eastern margin of the Philippines. The Lamont-Doherty
  Earth Observatory (LDEO) submitted these data to NODC as part of the NSF sponsored
  Rolling Deck to Repository (R2R) program.nnThe ADCP data represent the raw and automated
  processed data set. Post processed quality assessed data are not available in this
  accession.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
